values = {
    "Biathlon World Championships 2013": ["1 (0+0+0+1)", "10 (5+3+2+0)", "6 (2+2+2+0)"],
    "Crest Whitestrips": ["14 days", "10 days", "daily", "2 hours"],
    "Players": ["Corey Brewer", "Cristiano Felicio", "Danny Granger", "Dante Exum", "DeAndre Liggins"],
    "Basketball team": ["Lakers", "Nuggets", "Dodgers", "Mets"]
}

# Define the functions to answer the questions
def total_penalty_count(value):
    penalties = value.replace("(", "").replace(")", "").split("+")
    return sum(map(int, penalties))

def is_time_less_than_a_week(value):
    days = ["day", "days"]
    if "day" in value.lower() or "days" in value.lower():
        return True
    elif "hour" in value.lower():
        return False
    else:
        try:
            days_in_value = int(value.split(" ")[0])
            return days_in_value < 7
        except ValueError:
            return False

