    basketball_teams = ["Lakers", "Nuggets", "Celtics", "76ers", "Bulls", "Cavaliers", "Clippers", "Grizzlies", "Hawks", "Heat", "Hornets", "Jazz", "Kings", "Knicks", "Magic", "Mavericks", "Nets", "Pacers", "Pelicans", "Raptors", "Rockets", "Spurs", "Suns", "Thunder", "Timberwolves", "Trail Blazers", "Warriors", "Wizards"]
    return value in basketball_teams

def get_nationality(value):
    return value

# Create a DataFrame with the values
df = pd.DataFrame(values)

# Apply the functions to the values
df["Biathlon World Championships 2013"] = df["Biathlon World Championships 2013"].apply(total_penalty_count)
df["Crest Whitestrips"] = df["Crest Whitestrips"].apply(is_time_less_than_a_week)
df["Basketball team"] = df["Basketball team"].apply(is_basketball_team)
df["Players"] = df["Players"].apply(get_nationality)

